import { useState } from "react";
import {
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Typography,
} from "@mui/material";

export default function ModalStart({ open, onStart }) {
  const [openModal, setOpenModal] = useState(open);

  const handleStart = () => {
    setOpenModal(false);
    onStart();
  };

  return (
    <Dialog open={openModal}>
      <DialogTitle>¡Comencemos!</DialogTitle>
      <DialogContent>
        <Typography>
          Este es un test rápido tipo Kahoot. ¿Estás listo?
        </Typography>
      </DialogContent>
      <DialogActions>
        <Button variant="contained" onClick={handleStart}>
          Empezar
        </Button>
      </DialogActions>
    </Dialog>
  );
}
